import styled from "styled-components";

const Sidebar = styled.ul`
  border-right: 1px solid white;
  height: 93vh;
  text-align: left;
  width: 150px;
  font-family: "Mukta", sans-serif;
  margin: 0;
`;

const Options = styled.li`
  color: white;
  list-style-type: none;
  font-family: "Mukta", sans-serif;
  font-size: 16px;
`;

export { Sidebar, Options };
